import logo from "../logo.svg";

function Nav() {
    return;
    <div>
        <div className="logo-header">
            <img alt="logo makeitgrow" src={logo192} />
        </div>
        <div>
            <div className="link"></div>
            <div className="link"></div>
            <div className="link"></div>
        </div>
    </div>;
}
export default Nav;
